import React from 'react';
import Stories from "react-insta-stories";

function MCStories() {
  return (
    <div>
      <Stories
        stories={[
          { url: "../../assets/images.jpeg", duration: 5000},
          { url: "../../assets/@lepragram.mp4" },
          { url: "../../assets/giphy.gif" },
        ]}
        defaultInterval={1500}
        width={600}
        height={800}
      />
    </div>
  );
}

export default MCStories;
